import { useEffect, useState } from "react";
import { BrowserRouter, Navigate, Route, Routes } from "react-router-dom";
import { RouterLogin } from "../../login/routes/routerLogin";
import { IndexPerson } from "../../person/components";
import { RouterPerson } from "../../person/routes/routerPerson";
import { MainIndex } from "../components/main"; /* 
import { RouterMain } from "../components/main/routes/main.routes"; */
import { RouterMain } from "../components/main/routes/main.routes";
import { ProtectedRoutes } from "./ProtectedRoutes";
import routesFront from "./routesFrontend.routes";
export const RouterNavigate = () => {
  const [users, setUsers] = useState<boolean>(false);

  useEffect(() => {
    const tokenUsers = localStorage.getItem("tokenUser");
    if (tokenUsers) setUsers(true);
    else setUsers(false);
    console.log(users);
  }, [users]);

  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            users ? (
              <Navigate to={routesFront.module + routesFront.main} />
            ) : (
              <RouterLogin />
            )
          }
        />
        <Route path="/module/*" element={<ProtectedRoutes users={users} />}>
          <Route path="main" element={<MainIndex />} />
          <Route path="/person" element={<IndexPerson />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
};
